import React from "react";
import { HeaderContainer, H1, H2 } from "./styles";

const Header = ({ testFunction }) => (
  <HeaderContainer onClick={testFunction}>
    <H1>Landlines</H1>
    <H2>M12 Studio</H2>
  </HeaderContainer>
);

export default Header;
